import ExpenseItem from "./ExpenseItem";

function ExpensesDisplayer(props) {

    const title = props.title;
    const amount = props.amount;
    const date = props.date;
    return (
        <div className="expenses">
          <ExpenseItem
            title={props.title}
            amount={props.amount}
            date={props.date}
          />
        </div>
      );
}

export default ExpensesDisplayer;
